/* eslint-disable jsx-a11y/alt-text */
import React, { Component, useEffect } from 'react'
import browserLogo from '../images/browser.svg'
import cog from '../images/cog.svg'
import backwards from '../images/backwards.svg'

function Photo() {
  useEffect(() => {
  })

  return (
    <section class="browser">
      <h1>Reverse Searching Google Images</h1>
      <div class="browser-content">
        <p class="upper-light">
          Google Crawler to find domain links of uploaded Images.
        </p>
        <div class="file-row">
          <input class="image" type="file" name="image" />
          <button
            onClick={() => {
              let data = new FormData()
              let a = document.querySelector('.image').files[0]
              data.append('image', a)
              console.log(data)
              fetch('//localhost:3001/google', {
                method: 'POST',
                body: data
              }).then((data, err) => {
                if (err) console.log(err)
                console.log(data)
              })
            }}
          >
            Upload
          </button>
        </div>
      </div>
    </section>
  )
}

export default Photo
